import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  padding: 20px;
`;

const Heading = styled.h1`
  font-family: 'Concert One', sans-serif;
`;

const LikedTrend = styled.div`
  margin: 10px 0;
  padding: 10px;
  background-color: white;
  border-radius: 10px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const TrendImage = styled.img`
  width: 100%;
  height: auto;
  max-width: 300px;
  border-radius: 10px;
`;

const LikedTrendsPage = ({ likedTrends }) => {
  return (
    <Container>
      <Heading>Liked Trends</Heading>
      {likedTrends.map((trend, index) => (
        <LikedTrend key={index}>
          <TrendImage src={trend.image} alt={trend.name} />
          <h2>{trend.name}</h2>
        </LikedTrend>
      ))}
    </Container>
  );
};

export default LikedTrendsPage;
